description:
911 Mysteries
-------------

Beginning with a journey into the myth, the physics and the players emerging from the dust of America's most calamitous day. A serious but artistic work, replete with facts, graphics and witness testimonials. The official story carefully deconstructed in front of our eyes.

&quot;Excellent. The best of the 9/11 movies.&quot;
--David Ray Griffin, author of The New Pearl Harbor

&quot;WOW! is my reaction to this movie. Great insight into demolitions and what really happened on 9/11/2001.&quot;
--Steven E. Jones, physics professor, Brigham Young University

&quot;A superb work and asset to the patriot community and America itself.&quot;
--Aaron Russo, producer/director, America: From Freedom to Fascism


Run time: 90 minutes
